import React from 'react';
import Card from './Card';
import {robots} from './robots.js';

const CardList = () => {
    const loopCards = robots.map((robot, i) => {
        <Card id={robots[i].id} name={robots[i].name} email={robots[i].email}/>
    });



    return (
        <div>
            {loopCards}
        </div>

    )
}

export default CardList;
